import Navbar from './components/Navbar';
import News from './components/News';
import React, { Component } from 'react'
import {
  BrowserRouter as Router,
  Routes,
  Route,

  }
    from "react-router-dom";
import LoadingBar from 'react-top-loading-bar'


export default class App extends Component {
  //to render the variable suppose
 // c='John';
  render() {
    return (
      <div>
       {/*
     Hello My first name react app {this.c}  this.c rendering the up c which is define as a variable */}
    <Router>
    <Navbar/>
    <LoadingBar
        color='#f11946'
        progress={10}

      />
   <Routes>
    <Route exact path="/"element={<News key="entertainment"  pageSize={5} country="in" category="general"/>}/>
    <Route exact path="/business" element={<News key="business" pageSize={5} country="in" category="business"/>}/>
